import React from 'react';
import '../App.css';
import './Mail.css';


function Mail() {
  return (
    <div className='mail-container'>
    <h2>Contact Me</h2>
      <p>Are you interested in collaborating?</p>
      <p>Please send me an email or call me.</p> 
      <div class="row">
        <div class="column"><p><a href="mailto:michael@kelly.media"><i class="far fa-envelope fa-3x envelope"></i></a></p></div>
        <div class="column"><p><a href="tel:541-203-0711"><i class="fas fa-mobile-alt fa-3x phone"></i></a></p></div>
      </div>
    </div>
  );
}

export default Mail;
